var BookmarksView = Backbone.View.extend({

  initialize: function() {
    _.bindAll(this, 'fetch', 'render', 'unrender', 'scroll');

    this.collection = new BookmarksCollection();
    this.collection.bind('reset', this.render, this);
    this.collection.bind('add', this.render, this);

  },

  fetch: function(options) {
    this.search = false;
    if (options && typeof options.data != 'undefined') {
      this.search = true;
    }
    this.collection.fetch(options);
  },

  render: function() {

    this.offset = 50;

    if (this.search == false) {
      var self = this;
      $(window).scroll(function() { self.scroll(); });
    }

    //$(this.el).masonry('destroy');
    $('#app').html('').append(this.el);

    if (this.search == false && this.collection.models.length == 0) {

      $(this.el).css('width', '960px').css('margin', '0px auto');
      $(this.el).html(Templates.bookmarks);

    } else {

      $(this.el).css('margin', '90px auto 15px auto').css('width', 'auto').css('background', 'transparent');
      $(this.el).html('');
      //$(this.el).html(Templates.sort);
      $('#btn-sort-by-attributes-alt').addClass('active');

      var self = this;
      _(this.collection.models).each(function(bookmark) {
        var bmv = new BookmarkView({ model: bookmark });
        bmv.render();
        $(self.el).append(bmv.el);
      });

      $(this.el).masonry({
        itemSelector: '.item',
        columnWidth: 255,
        isFitWidth: true
      });

    }

  },

  unrender: function() {
    $(this.el).masonry('destroy').detach();
    $(window).unbind('scroll');
  },

  scroll: function() {
    var bottom = $(document).height() - $(window).height() - 50 <= $(window).scrollTop();

    var self = this;
    if (bottom) {
      $(window).unbind('scroll');
      $.getJSON('./api/v1/bookmark?offset=' + self.offset, function(data) {
        self.collection.unbind('add');

        self.offset += 50;
        self.collection.add(data);

        _(data).each(function(bookmark) {
          var bmv = new BookmarkView({ model: new Bookmark(bookmark) });
          bmv.render();
          $(self.el).append(bmv.el).masonry('appended', $(bmv.el), true);
        });

        $(window).scroll(function() { self.scroll(); });

        self.collection.bind('add', self.render, self);
      });
    }
  }

});

var EditView = Backbone.View.extend({

  events: {
    "click .save":            "save",
    "click .cancel":          "cancel",
    "submit form":            "save"
  },

  initialize: function() {
    _.bindAll(this, 'render', 'unrender', 'save', 'cancel');

    Backbone.Validation.bind(this);
  },

  render: function() {
    var source = Templates.edit;

    this.model.get('public') === '1' ? is_public = 'checked' : is_public = '';
    var model = _.extend(this.model.toJSON(), {is_public: is_public});

    var template = Handlebars.compile(source);
    var html = template(model);
    $(this.el).html(html);

    $('body').append(this.el);
    this.$('input[name=tags]').attr('id', 'tags' + this.model.id);
    this.$('input[name=tags]').tagsInput({
      autocomplete: {
        source: '/api/v1/autocomplete'
      },
      width: '367px'
    });

    this.$('#public').wrap('<div class="switch" id="switch_wrapper"/>').parent().bootstrapSwitch();
    this.$('#switch_wrapper').on('switch-change', function (e, data) {
      $(data.el).attr('checked', data.value);
    });

    $(this.el).modal({
      backdrop: true,
      keyboard: false,
      show: true
    });
  },

  unrender: function() {
    $(this.el).modal('hide');
    $(this.el).remove();
  },

  save: function(e) {
    e.preventDefault();

    var url = this.$('input[name=url]').val();
    var title = this.$('input[name=title]').val();
    var description = this.$('input[name=description]').val();
    var share = this.$('input[name=public]').attr('checked') ? '1' : '0';
    var taglist = this.$('input[name=tags]').val();
    var tags = Array();

    if (taglist.indexOf(',') !== -1) {
      tags = taglist.split(',');
    } else if (taglist.length > 0) {
      tags.push(taglist);
    }

    this.$('.alert').hide();

    if (this.model.set({ url: url, title: title, description: description, public: share, tags: tags, created_at: new Date() }, {validate:true})) {
      this.model.save();
      this.unrender();

      if (this.model.isNew()) {
        App.router.view.body.collection.add(this.model, { at: 0 });
      } else {
        $(App.router.view.body.el).masonry('reload');
      }
    } else {
      this.$('.alert-error').fadeIn();
    }
  },

  cancel: function(e) {
    e.preventDefault();
    this.unrender();
  }
});

